	(53, 'KCH HOT THNH VIN', '<ol>\r\n<li><span style="background-color: #2dc26b;"> k&iacute;ch hot th&agrave;nh vi&ecirc;n s mt ph&iacute; 20k coin</span></li>\r\n<li><span style="background-color: #2dc26b;">kh&ocirc;ng k&iacute;ch hot vn c&oacute; th chi nhng kh&ocirc;ng th nhp c code (tr&aacute;nh lm ph&aacute;t)</span></li>\r\n</ol>'),
	(54, 'CC CHC NNG HIN C', '<p><span style="background-color: #2dc26b;">Rt nhiu chc nng gn full nh server team. sau &acirc;y l&agrave; c&aacute;c chc nng ni bt, c&ograve;n c&aacute;c chc nng chc chn phi c&oacute; th&igrave; kh&ocirc;ng lit k&ecirc; nh&eacute;.</span></p>\r\n<p><span style="background-color: #2dc26b;">Server s tip tc ph&aacute;t trin th&ecirc;m c&aacute;c chc nng c&ograve;n thiu nh : bossphe, boss n, m&ecirc; cung, skill, ci trang mi ...vv</span></p>\r\n<p><span style="background-color: #f8cac6;">C&aacute;c chc nng hin c&oacute;:</span></p>\r\n<ol>\r\n<li>Ph&oacute; bn</li>\r\n<li>Chin trng (chun team)</li>\r\n<li>Chim th&agrave;nh (chun team)</li>\r\n<li>i bu&ocirc;n</li>\r\n<li>Chim m</li>\r\n<li>Trang b tinh t&uacute;</li>\r\n<li>M ay</li>\r\n<li>V&ograve;ng xoay v&agrave;ng</li>\r\n<li>V&ograve;ng xoay ngc</li>\r\n<li>Sn boss</li>\r\n</ol>'),
	(55, 'GIFTCODE OPEN', '<ol>\r\n<li>tanthu</li>\r\n<li>gamefinal</li>\r\n<li>open</li>\r\n<li>box400</li>\r\n<li>codemoine</li>\r\n<li>baotri</li>\r\n<li>codevui</li>\r\n<li>vnvodich</li>\r\n<li><span style="background-color: #f8cac6;">vulanbaohieu</span></li>\r\n</ol>\r\n<p><span style="background-color: #2dc26b;">Trong code s c&oacute; c&aacute;c phn qu&agrave; nh v&agrave;ng, ngc, rng, l&ocirc;ng</span></p>'),
	(56, 'LCH M EVENT', '<p><span style="background-color: #2dc26b;">SERVER s m event sau khi ua top kt th&uacute;c</span></p>'),
	(57, 'NGUYN LIU M AY', '<p><span style="background-color: #2dc26b;">NGUY&Ecirc;N LIU M AY S C&Oacute; C BNG C&Aacute;C C&Aacute;CH SAU:</span></p>\r\n<ol>\r\n<li>Nguy&ecirc;n liu trng c&oacute; th kim c bng c&aacute;ch up qu&aacute;i thng</li>\r\n<li>Nguy&ecirc;n liu xanh c&oacute; th kim uc bng c&aacute;ch i ph&oacute; bn</li>\r\n<li>Nguy&ecirc;n liu v&agrave;ng c&oacute; th kim uc bng c&aacute;ch tham gia chin trng</li>\r\n<li>Nguy&ecirc;n liu t&iacute;m c&oacute; th kim uc bng c&aacute;ch sn boss</li>\r\n<li>Ngo&agrave;i ra i chim th&agrave;nh c&oacute; th nhn c nguy&ecirc;n liu v&agrave;ng v&agrave; t&iacute;m</li>\r\n</ol>'),
	(58, 'COIN DNG  LM G', '<p><span style="background-color: #bfedd2;">coin hin ti d&ugrave;ng  k&iacute;ch hot th&agrave;nh vi&ecirc;n.</span></p>\r\n<p><span style="background-color: #bfedd2;">ngo&agrave;i ra c&oacute; th v&agrave;o zulu  quy i ra v&agrave;ng v&agrave; ngc.</span></p>\r\n<p><span style="background-color: #f8cac6;">Sau n&agrave;y game s update th&ecirc;m c&aacute;c hot ng b&ecirc;n ngo&agrave;i  c&oacute; th d&ugrave;ng n ch&uacute;ng</span></p>'),
	(59, 'S KIN VU LAN', '<div class="box_ndung_bviet"><center><img src="http://my.teamobi.com/app/view/forum/16594960179349.png" /></center><br /><br /><center><span style="color: red;">B&Oacute; HOA VU LAN</span></center><br /><br />- Trong thi gian din ra s kin vu lan . Tt c hip s h&atilde;y c&ugrave;ng nhau thu thp nhng b&ocirc;ng sen trng <img src="http://my.teamobi.com/app/view/forum/16594932482829.png" /> ri em n NPC Miss Sophia  i nhng b&oacute; hoa nh&eacute;<br /><br />- C&aacute;c hot ng s ri b&ocirc;ng sen trng <br /><br />1. &aacute;nh qu&aacute;i +- 5 level<br />2. <span style="color: #626262;">&aacute;nh qu&aacute;i trong</span> ph&oacute; bn&nbsp;</div>\r\n<div class="box_ndung_bviet">3.&nbsp;<span style="color: #626262;">&aacute;nh qu&aacute;i level 133 tr l&ecirc;n</span><br />- Khi c&aacute;c bn thu thp  b&ocirc;ng sen trng <img src="http://my.teamobi.com/app/view/forum/16594932482829.png" /> c&oacute; th i ly th&agrave;nh b&oacute; hoa trng <img src="http://my.teamobi.com/app/view/forum/16594932488707.png" /> c&ocirc;ng thc :<br /><br />30 b&ocirc;ng sen trng <img src="http://my.teamobi.com/app/view/forum/16594932482829.png" /> + v&agrave;ng = 1 b&oacute; sen trng <img src="http://my.teamobi.com/app/view/forum/16594932488707.png" /><br /><br />- D&ugrave;ng b&oacute; hoa trng s ngu nhi&ecirc;n nhn c vt phm sau :<br /><br />Ko bc h&agrave; <br />Ko hng cam<br />Ko the<br />Ko sa<br />Rng <br />Rng t&iacute;m<br />Titan<br />St vn<br />C ba l&aacute; <br />Kim loi v tr<br />L&ocirc;ng xanh<br />L&ocirc;ng <br />L&ocirc;ng v&agrave;ng<br />Nl tinh t&uacute;&nbsp;<br />Hi sinh ti ch<br />200-300 B&igrave;nh HP 6.000<br />200-300 B&igrave;nh MP 600<br />Nc ra ti<br />V&eacute; m ly&nbsp;<br />M&acirc;y<br />B&ograve; v&agrave;ng<br />S&aacute;ch tri thc<br /><br /><br />Lu &yacute; : <br />- H&agrave;nh trang y s mt qu&agrave; admin kh&ocirc;ng chu tr&aacute;ch nhim<br />- Lng &egrave;n sao hng b&aacute;n bng v&agrave;ng trong Lisa , thi gian s dng l&agrave; 1 ting v&agrave; loi 10 ting . Kh&ocirc;ng th s dng cng dn. V&agrave; khi th&aacute;o lng &egrave;n l&agrave; s mt lu&ocirc;n<br />- Max nhp s lng i 1 ln l&agrave; 200<br /><br /><center><span style="color: red;">B&Oacute; HOA SEN HNG</span></center><br /><br />- C&oacute; th i b&ocirc;ng sen trng th&agrave;nh b&ocirc;ng sen hng theo c&ocirc;ng thc<br /><br />10 b&ocirc;ng sen trng <img src="http://my.teamobi.com/app/view/forum/16594932482829.png" /> + v&agrave;ng = 1 b&ocirc;ng sen hng <img src="http://my.teamobi.com/app/view/forum/16594932485118.png" /> <br /><br />5 b&ocirc;ng sen hng <img src="http://my.teamobi.com/app/view/forum/16594932485118.png" /> + ngc = 1 b&oacute; sen hng <img src="http://my.teamobi.com/app/view/forum/16594941922226.png" /><br /><br />- Khi s dng b&oacute; sen hng <img src="http://my.teamobi.com/app/view/forum/16594941922226.png" /> nhn c ngu nhi&ecirc;n<br /><br />Ngu nhi&ecirc;n v&agrave;ng<br />Rng v&agrave;ng<br />V&eacute; x2 i bu&ocirc;n<br />C 4 l&aacute;<br />C 3 l&aacute;<br />Ha  l&acirc;n<br />M&acirc;y<br />&aacute; ba m&agrave;u<br />V&eacute; m ly<br />V&eacute; t ng &aacute;nh<br />&aacute; ha tinh<br />nltt ngu nhi&ecirc;u<br />Nguy&ecirc;n liu m ay v&agrave;ng/t&iacute;m cp 1 ngu nhi&ecirc;n<br />Th&aacute;nh gi&aacute;<br />Xng<br />c huyn b&iacute; cp 1<br />&aacute; thch anh cp 1<br /><span style="color: #626262;">S&aacute;ch skill 110 kh&ocirc;ng kh&oacute;a</span><br /><br /><br />Lu &yacute; : <br />- H&agrave;nh trang y s mt qu&agrave; admin kh&ocirc;ng chu tr&aacute;ch nhim<br />- Max nhp s lng i 1 ln l&agrave; 200<br /><br /><center><span style="color: red;">C NGUYN C&Ugrave;NG BN</span></center><br /><center><img src="http://my.teamobi.com/app/view/forum/16594941925168.png" /></center><br /><br /><img src="http://my.teamobi.com/app/view/forum/16594949977250.png" /> Hoa ng b&aacute;n  ca h&agrave;ng Lisa/Emma. Hip s khi s dng hoa ng nhp t&ecirc;n nh&acirc;n vt kh&aacute;c  c&ugrave;ng nhau c nguyn nhn qu&agrave; tng. C ngi tng v&agrave; ngi c tng u c&oacute; qu&agrave;.<br />- Phn qu&agrave; c nguyn hoa ng ngu nhi&ecirc;n :<br /><br /><br />Rng v&agrave;ng<br />V&eacute; x2 i bu&ocirc;n <br />C 4 l&aacute;<br />C 3 l&aacute;<br />Ha k l&acirc;n<br />M&acirc;y<br />&aacute; ba m&agrave;u<br />V&eacute; m ly<br />V&eacute; t ng &aacute;nh <br />&aacute; ha tinh<br />NLTT ngu nhi&ecirc;n<br />Nguy&ecirc;n liu m ay v&agrave;ng/t&iacute;m cp 1 ngu nhi&ecirc;n<br />Th&aacute;nh gi&aacute;<br />Xng<br />c huyn b&iacute; cp 1<br />&aacute; thch anh cp 1<br />Kim loi v tr<br />&aacute; may mn<br />L&ocirc;ng xanh//v&agrave;ng<br />Tng tc c&aacute;nh cp 1<br />B&ocirc;ng sen trng/hng<br />S&aacute;ch skill 110 kh&ocirc;ng kh&oacute;a<br /><br /><br />Lu &yacute; : <br />- H&agrave;nh trang y s mt qu&agrave; admin kh&ocirc;ng chu tr&aacute;ch nhim<br />- Max nhp s lng i 1 ln l&agrave; 200<br />- Ngi tng v&agrave; c tng phi ng gn nhau nh&eacute;<br /><br /><center><span style="color: red;">UA TOP HOA NG</span></center><br /><br />Top 1 :<br />1 d&acirc;y chuyn mt trng vnh vin kh&ocirc;ng kh&oacute;a [c tng]<br />1 trng pet rng la vnh vin [c tng]<br />1 c&aacute;nh thi trang vnh vin ngu nhi&ecirc;n<br />5 &aacute; krypton cp 2<br /><br />Top 2 :<br />1 nhn mt trng vnh vin [c tng]<br />1 trng pet rng la vnh vin [c chn nh&acirc;n vt tng]<br />1 c&aacute;nh thi trang 6 th&aacute;ng&nbsp;<span style="color: #626262;">ngu nhi&ecirc;n</span><br />3 &aacute; krypton cp 1<br /><br />Top 3 :<br />1 nhn mt trng vnh vin [c tng]<br />1 trng pet rng la 6 th&aacute;ng&nbsp;<br /><span style="color: #626262;">1 c&aacute;nh thi trang 6 th&aacute;ng&nbsp;</span><span style="color: #626262;">ngu nhi&ecirc;n</span><br />2 &aacute; krypton cp 1<br /><br />Top 4-10<br />1 tai nghe xanh/ vnh vin [t chn]<br />1 trng pet rng la 6 th&aacute;ng<br /><span style="color: #626262;">1 c&aacute;nh thi trang 2 th&aacute;ng </span><span style="color: #626262;">ngu nhi&ecirc;n</span><br /><br /><br />Lu &yacute; :</div>\r\n<div class="box_ndung_bviet">- <span style="background-color: #f8cac6;">&Egrave;N HOA NG C&Oacute; GI&Aacute; 1TR V&Agrave;NG</span></div>\r\n<div class="box_ndung_bviet">- TOP KH&Ocirc;NG T&Iacute;NH NG HNG [NGI N&Agrave;O T S LNG &Oacute; TRC XP TRC LY TRC]<br />- Ti thiu top phi t s lng &gt; 3.000. Ri&ecirc;ng top 1-2-3 phi ti thiu &gt; 5.000<br /><br /><center><span style="color: red;">I QU&Agrave; C BIT</span></center><br /><br />50 b&ocirc;ng sen hng + 200ngc = 1 t<span style="color: #444444; font-family: sans-serif; font-size: 13.12px; white-space-collapse: preserve; background-color: #ffffff;">rng kh n&acirc;u</span>&nbsp;[thi hn 15 ng&agrave;y]<br />50 b&ocirc;ng sen hng + 200ngc = 1 trng tiu y&ecirc;u tinh [thi hn 15 ng&agrave;y]<br />50 b&ocirc;ng sen hng + 500ngc = 1 c<span style="background-color: #ffffff; color: #000000; font-family: sans-serif; font-size: 13.12px; white-space-collapse: preserve;">&aacute;nh l&ocirc;ng v thi trang</span>&nbsp;[thi hn 30 ng&agrave;y]</div>\r\n<div class="box_ndung_bviet">10 b&ocirc;ng sen hng + 100ngc = 100 th&uacute; ci con l&acirc;n<br /><br /><br />Lu &yacute;<br />Trng c&oacute; thi hn nh trang b, k c kh&ocirc;ng p vn ht hn b&igrave;nh thng<br /><br /><br /><strong>Thi gian din ra v&agrave; kt th&uacute;c s kin s c BQT th&ocirc;ng b&aacute;o sau<br /></strong><br /><center></center></div>'),
	(60, 'QU TOP NP SK VULAN', '<p>Top 1:</p>\r\n<p>Gi&aacute;p Hellwing vnh vin&nbsp;</p>\r\n<p>D&acirc;y chuyn mt trng vnh vin</p>\r\n<p>Gy mt trng vnh vin</p>\r\n<p>Th&uacute; ci C&acirc;n u v&acirc;n vnh vin</p>\r\n<p>&Aacute;o cho&agrave;ng t ph&uacute; vnh vin&nbsp;</p>\r\n<p>Khu trang  vnh vin&nbsp;</p>\r\n<p>Tai nghe vnh vin&nbsp;</p>\r\n<p>100 nguy&ecirc;n liu v&agrave;ng c3 ( ramdom)&nbsp;</p>\r\n<p>100 nguy&ecirc;n liu t&iacute;m c3</p>\r\n<p>40 &aacute; ha tinh&nbsp;</p>\r\n<p>40 &aacute; kryton c3&nbsp;</p>\r\n<p>30 &aacute; 3 m&agrave;u</p>\r\n<p>Top 2:</p>\r\n<p>Gi&aacute;p Deathwing vnh vin&nbsp;</p>\r\n<p>Gy mt trng 30 ng&agrave;y</p>\r\n<p>Nhn mt trng vnh vin</p>\r\n<p>Th&uacute; ci Nga Skeleton vnh vin</p>\r\n<p>&Aacute;o cho&agrave;ng triu ph&uacute; vnh vin&nbsp;</p>\r\n<p>Khu trang  vnh vin&nbsp;</p>\r\n<p>50 nguy&ecirc;n liu v&agrave;ng c3 ( ramdom)&nbsp;</p>\r\n<p>50 nguy&ecirc;n liu t&iacute;m c3</p>\r\n<p>15 &aacute; ha tinh&nbsp;</p>\r\n<p>15 &aacute; kryton c3&nbsp;</p>\r\n<p>20 &aacute; 3 m&agrave;u</p>\r\n<p>Top 3:</p>\r\n<p>Gi&aacute;p Deathwing vnh vin&nbsp;</p>\r\n<p>Th&uacute; ci Rng bng vnh vin</p>\r\n<p>&Aacute;o cho&agrave;ng i gia vnh vin&nbsp;</p>\r\n<p>Khu trang  vnh vin&nbsp;</p>\r\n<p>25 nguy&ecirc;n liu v&agrave;ng c3 ( ramdom)&nbsp;</p>\r\n<p>25 nguy&ecirc;n liu t&iacute;m c3</p>\r\n<p>10 &aacute; ha tinh&nbsp;</p>\r\n<p>10 &aacute; kryton c3&nbsp;</p>\r\n<p>15 &aacute; 3 m&agrave;u</p>\r\n<p>Top 4 &ndash; 10:</p>\r\n<p>Gi&aacute;p Xng kh&ocirc; vnh vin</p>\r\n<p>Th&uacute; ci Nga skeleton x99</p>\r\n<p>10 nguy&ecirc;n liu v&agrave;ng c3 ( ramdom)&nbsp;</p>\r\n<p>10 nguy&ecirc;n liu t&iacute;m c3</p>\r\n<p>7 &aacute; ha tinh&nbsp;</p>\r\n<p>7 &aacute; kryton c3&nbsp;</p>\r\n<p>10 &aacute; 3 m&agrave;u&nbsp;</p>\r\n<p>Lu &yacute;; T<span style="color: #626262; background-color: #f8cac6;">op 1 2 3 phi np t 2tr coin tr l&ecirc;n mi nhn c t&iacute;nh, nu kh&ocirc;ng s nhn qu&agrave; nh top 4-10</span></p>\r\n<p>Sk ua top np kt th